import React from 'react';
import { BrowserRouter as Router , Route, Switch } from "react-router-dom";
import Login from './containers/Login'
import ChiefOfProject from './containers/chief-of-project'
import ResponsibleOfProtocol from './containers/responsible-of-protocol'
import Protocol from './containers/protocol'

class App extends React.Component {
    render() {
      return(
        <Router>
          <Switch>
            <Route path="/login" component={Login}/>
            <Route path="/chief" component={ChiefOfProject}/>
            <Route path="/responsible" component={ResponsibleOfProtocol}/>
            <Route path="/protocol" component={Protocol}/>
          </Switch>
        </Router>
      )
    }
}

export default App;
